from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
prime_hub = PrimeHub()
left = Motor(Port.A, Direction.COUNTERCLOCKWISE)
right = Motor(Port.B, Direction.CLOCKWISE)
arm_vert = Motor(Port.C, Direction.COUNTERCLOCKWISE)
arm_horiz = Motor(Port.D, Direction.COUNTERCLOCKWISE)
drive_base_2_2 = DriveBase(left, right, 88, 71.3)

def Setup():
    drive_base_2_2.use_gyro(True)
    drive_base_2_2.use_gyro(False)
    arm_horiz.run_target(500, 0)
    arm_vert.run_target(500, -90)

def Get_To_Mission():
    drive_base_2_2.straight(700)
    drive_base_2_2.turn(-120)

def Solve_():
    arm_horiz.run_angle(500, 90)
    arm_horiz.run_angle(500, -180)
    arm_horiz.run_angle(500, 90)

def Get_to_mission_2():
    drive_base_2_2.turn(90)
    drive_base_2_2.straight(-20)

def Solve_Misson_2():
    arm_vert.run_target(500, 12)
    drive_base_2_2.straight(150)

def Get_to_Solve_mission_3():
    arm_vert.run_target(500, 90)
    drive_base_2_2.straight(-30)


# The main program starts here.
Setup()
Get_To_Mission()
Solve_()
Get_to_mission_2()
Solve_Misson_2()
Get_to_Solve_mission_3()
